import React, { Component } from "react";

class Button extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <button className="border-2 border-gray-600 rounded-lg bg-sky-300 w-24 text-black font-bold p-3 flex justify-center items-center mr-14 hover:bg-red-300 shadow-inner">
        {this.props.title}
      </button>
    );
  }
}

export { Button };
